import { useState } from "react";
import { Link } from "react-router-dom";
const lii = "https://www.clipartmax.com/png/small/351-3518256_menu-hamburger-icon-svg-white.png";

const Tab = ({isclick}) => {
    return (
        isclick && <div style={{display : "flex", flexDirection : "column", backgroundColor : "gray"}}>
        <div style={{backgroundColor : "black", color : "white", width : "fit-content"}}>About</div>
        <div style={{backgroundColor : "black", color : "white", width : "fit-content"}}>Support</div>
        </div>
    )
}

const Ham = () => {
    const userid = localStorage.getItem("userid");
    const [isopen, setopen] = useState(false);
    return (
        <div className="navv" style = {nav}>
            <img onClick={() => {setopen(!isopen)}}
            height={"50px"}
            src={lii} />
            {userid && <div style={{overflowWrap : "break-word"}}><Link style={{fontSize : "25px"}} to="/profile">userid</Link></div>}
            <Tab isclick={isopen} />
            {!userid ? (
        <div style={{marginLeft : "auto", marginRight : "10%"}}>
          <Link to="/login" ><button className="btnlgout" type="submit" style={{width : "fit-content", backgroundColor : "orange" ,
                  borderRadius : "5px", padding: "10px 20px", color : "white", border : "none"}}>
              Login/Signup
          </button>
          </Link>
        </div>
      ) : (
        <div style={{marginLeft : "auto", marginRight : "10%"}}>
          <Link to="/"><button className="btnlgout" type="submit" onClick={handleLogout} style={{width : "fit-content", backgroundColor : "orange" ,
                  borderRadius : "5px", padding: "10px 20px", color : "white", border : "none"}}>
              Logout
          </button>
          </Link>
        </div>
      )}
        </div>
    );
}

const nav = {
    display: "flex",
    justifyContent: "space-evenly",
    padding : "10px",
    borderRadius: "20px",
    borderBottom : "1px solid black",
  };

export default Ham;
